{
  "parser": "babel-eslint",
  "extends": ["tamia/react", "plugin:jsx-a11y/recommended"],
  "env": {
    "browser": true,
    "node": true
  },
  "plugins": ["compat", "import", "jsx-a11y"],
  "settings": {
    "import/resolver": {
      "node": {
        "extensions": [".js", ".json", ".ts"]
      }
    },
    "react": {
      "version": "16.6"
    }
  },
  "rules": {
    "valid-jsdoc": 0,
    "no-duplicate-imports": 0,
    "compat/compat": "error",
    "import/export": "error",
    "import/no-named-as-default-member": "error",
    "import/no-mutable-exports": "error",
    "import/no-amd": "error",
    "import/first": ["error", "absolute-first"],
    "import/no-duplicates": "error",
    "import/extensions": [
      "error",
      "always",
      {
        "js": "never",
        "tsx": "never",
        "ts": "never",
        "mjs": "never"
      }
    ],
    "import/no-extraneous-dependencies": "error",
    "import/newline-after-import": "error",
    "import/prefer-default-export": "error",
    "import/no-named-default": "error"
  },
  "globals": {
    "System": false,
    "classes": false,
    "shallow": false,
    "render": false,
    "mount": false,
    "cy": false
  },
  "overrides": [
    {
      "files": ["*.spec.js"],
      "rules": {
        "compat/compat": 0
      }
    },
    {
      "files": ["*.ts", "*.tsx"],
      "parser": "@typescript-eslint/parser",
      "parserOptions": {
        "project": "./tsconfig.json"
      },
      "settings": {
        "import/resolver": {
          "typescript": {}
        }
      },
      "plugins": ["@typescript-eslint"],
      "extends": ["tamia/typescript-react"]
    }
  ]
}

module.exports = {
	presets: [
		[
			'@babel/env',
			{
				loose: true,
				modules: false,
				useBuiltIns: 'usage',
				corejs: 3,
			},
		],
		'@babel/typescript',
		'@babel/react',
	],
	plugins: ['@babel/plugin-proposal-class-properties'],
	overrides: [
		{
			include: ['src/bin', 'src/loaders', 'src/scripts', 'src/share', 'src/typings'],
			exclude: ['src/loaders/utils/client'],
			presets: [
				[
					'@babel/env',
					{
						loose: true,
						modules: 'commonjs',
						useBuiltIns: 'usage',
						corejs: 3,
						targets: {
							node: '10',
						},
					},
				],
			],
		},
	],
	env: {
		test: {
			presets: [
				[
					'@babel/env',
					{
						loose: true,
						modules: 'commonjs',
						useBuiltIns: 'usage',
						corejs: 3,
						targets: {
							node: 'current',
						},
					},
				],
				'@babel/react',
				'@babel/flow',
			],
			plugins: ['@babel/plugin-proposal-class-properties'],
		},
	},
};

import { danger, warn } from 'danger';

const packageChanged = danger.git.modified_files.includes('package.json');
const lockfileChanged = danger.git.modified_files.includes('package-lock.json');

if (packageChanged && !lockfileChanged) {
	warn(`Changes were made to \`package.json\`, but not to \`package-lock.json\`.

If you’ve changed any dependencies (added, removed or updated any packages), please run \`npm install\` and commit changes in package-lock.json file. Make sure you’re using npm 5+.`);
}

if (!packageChanged && lockfileChanged) {
	warn(`Changes were made to \`package-lock.json\`, but not to \`package.json\`.

Please remove \`package-lock.json\` changes from your pull request. Try to run \`git checkout master -- package-lock.json\` and commit changes.`);
}

